import React, {createContext, useState} from 'react';

export const FilterContext = createContext();

const FilterContextProvider = (props) => {
	const [startDate, setStartDate] = useState('default start date');
	const [endDate, setEndDate] = useState('default end date');
	const [store, setStore] = useState('default store');

	return (
		<FilterContext.Provider value={{startDate, setStartDate, endDate, setEndDate, store, setStore}}>
			{props.children}
		</FilterContext.Provider>
	);
}

export default FilterContextProvider;
